import "./emptyclass.css"
import { useNavigate } from "react-router-dom"
import axios from "axios";
import { useState } from 'react';

const emptyclass = () => {
    const navigate = useNavigate();
    const [activeBuilding, setActiveBuilding] = useState(null);
    const [activeTime, setActiveTime] = useState([]);
    const [buttonStyle, setButtonStyle] = useState({});
    const [activeDay, setActiveDay] = useState(null);
    const [activeWeek, setActiveWeek] = useState(null);
    const [building_num, setBuildingNum] = useState(null);
    const [class_nums, setClassNums] = useState([]);
    const [weekday, setWeekday] = useState(null);
    const [week_num, setWeekNum] = useState(null);
    const buildingFloors = new Map();
    for (let i = 2; i <= 8; i++) {
        for (let j = 1; j <= 6; j++) {
            buildingFloors.set(`b${i}f${j}`, useState([]));
        }
    }

    function handleTimeClick(timeId) {
        setActiveTime(prevTimes => prevTimes.includes(timeId) ? prevTimes.filter(id => id !== timeId) : [...prevTimes, timeId]);
        setButtonStyle({ backgroundColor: 'rgb(246,195,66)', color: 'white' });
    }

    function handleDayClick(dayId) {
        setActiveDay(dayId);
        setButtonStyle({ backgroundColor: 'rgb(246,195,66)', color: 'white' });
    }

    function handleWeekClick(weekId) {
        setActiveWeek(weekId);
        setButtonStyle({ backgroundColor: 'rgb(246,195,66)', color: 'white' });
    }

    function emptyHandler() {
        navigate("/home/")
    }

    function handleBuildingClick(buildingId) {
        setActiveBuilding(buildingId);
        setButtonStyle({ backgroundColor: 'rgb(246,195,66)', color: 'white' });
    }

    function getemptyInfo(floor_rooms){
        for (let i = 0; i < floor_rooms.length; i++) {
            const [setFloorState] = buildingFloors.get(`${activeBuilding}f${floor_rooms[i].floor}`);
            setFloorState(floor_rooms[i].room.join(' '));
        }
        return(floor_rooms)
    }
    
    function getemptyHandler(week_num, weekday, building_num, class_nums) {
        const class_nums_string = JSON.stringify(class_nums);
        axios({
            method: "get",
            url: '/api/empty_room',
            headers: {
                "Content-Type": 'application/form-data',
                "traefik": "jwzx",
            },
            params: {
                week_num,
                weekday,
                building_num,
                class_nums: class_nums_string
            }
        }).then(res => {
           //console.log(res);
            // console.log(res.data.data.room_list.floor_rooms[0]);
            const floor_rooms=res.data.data.room_list.floor_rooms;
            getemptyInfo(floor_rooms);
            // console.log(class_nums);
        }, err => {
            console.log(err)
        });
    }
    return (
        <div id="empty-bg" >
            <div id="emphead">
                <button id="empbtn" onClick={emptyHandler}><img src={require("./emptypic/returnarrow.png")} id="emparr" /></button>
                空闲教室
            </div>
            {activeBuilding === 'build2' && <div className="emptychoice" id="build2">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /><div className="classNum">{b2f1}</div></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /><div className="classNum">{b2f2}</div></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /><div className="classNum">{b2f3}</div></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /><div className="classNum">{b2f4}</div></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /><div className="classNum">{b2f5}</div></div>
            </div>}
            {activeBuilding === 'build3' && <div className="emptychoice" id="build3">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /><div className="classNum">{b3f1}</div></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /><div className="classNum">{b3f2}</div></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /><div className="classNum">{b3f3}</div></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /><div className="classNum">{b3f4}</div></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /><div className="classNum">{b3f5}</div></div>
            </div>}
            {activeBuilding === 'build4' && <div className="emptychoice" id="build4">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /><div className="classNum">{b4f1}</div></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /><div className="classNum">{b4f2}</div></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /><div className="classNum">{b4f3}</div></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /><div className="classNum">{b4f4}</div></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /><div className="classNum">{b4f5}</div></div>
                <div className="floordiv" id="f6div"><img src={require("./emptypic/6f.jpg")} id="f6" className="buildingpic" /><div className="classNum">{b4f6}</div></div>
            </div>}
            {activeBuilding === 'build5' && <div className="emptychoice" id="build5">
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /><div className="classNum">{b5f1}</div></div>
                <div className="floordiv" id="f3div"><img src={require("./emptypic/3f.jpg")} id="f3" className="buildingpic" /><div className="classNum">{b5f2}</div></div>
                <div className="floordiv" id="f4div"><img src={require("./emptypic/4f.jpg")} id="f4" className="buildingpic" /><div className="classNum">{b5f3}</div></div>
                <div className="floordiv" id="f5div"><img src={require("./emptypic/5f.jpg")} id="f5" className="buildingpic" /><div className="classNum">{b5f4}</div></div>
            </div>}
            {activeBuilding === 'build8' && <div className="emptychoice" id="build8">
                <div className="floordiv" id="f1div"><img src={require("./emptypic/1f.jpg")} id="f1" className="buildingpic" /><div className="classNum">{b8f1}</div></div>
                <div className="floordiv" id="f2div"><img src={require("./emptypic/2f.jpg")} id="f2" className="buildingpic" /><div className="classNum">{b8f2}</div></div>
            </div>}
            <div id="classchoice">
                <div className="choicediv">
                    <div className="btndiv"><button id="btnbuild2" className="buildingbtn" onClick={() => { handleBuildingClick('build2'); setBuildingNum(2); }} style={activeBuilding === 'build2' ? buttonStyle : {}}>二教</button></div>
                    <div className="btndiv"><button id="btnbuild3" className="buildingbtn" onClick={() => { handleBuildingClick('build3'); setBuildingNum(3); }} style={activeBuilding === 'build3' ? buttonStyle : {}}>三教</button></div>
                    <div className="btndiv"><button id="btnbuild4" className="buildingbtn" onClick={() => { handleBuildingClick('build4'); setBuildingNum(4); }} style={activeBuilding === 'build4' ? buttonStyle : {}}>四教</button></div>
                    <div className="btndiv"><button id="btnbuild5" className="buildingbtn" onClick={() => { handleBuildingClick('build5'); setBuildingNum(5); }} style={activeBuilding === 'build5' ? buttonStyle : {}}>五教</button></div>
